    false,nt"url": null,nt"notes": "This geospatial data set contains an interpolated
    3-D surface or, triangulated-irregular network (TIN), of the change in elevation,
    in feet, of the substrate between cross-sections 22 and 35 following construction
    of Emergent Sandbar Habitat near River Mile 770. The surface was generated from
    points collected by the echosounder and real-time kinematic (RTK) GPS on cross-sections
    in the downstream project reach surrounding the construction area at River Mile
    770 below Gavins Point Dam on the Missouri River in South Dakota before and after
